  type IInput = {
    inputText: string;
  };
  const InputInitialValues = {
    inputText: ''
  };
  const InputValidationSchema = Yup.object().shape({
    inputText: Yup.string().required('The field is required')
  });
  const onSubmit = async (values: IInput, actions: FormikHelpers<IInput>) => {
    actions.setSubmitting(true);
    alert(JSON.stringify(values, null, 2));
    await sleep(1000);
    actions.setSubmitting(false);
  };
  const onReset: MouseEventHandler<HTMLButtonElement> = () => {
    formikProps.resetForm();
  };
  const formikProps = useFormik({
    initialValues: InputInitialValues,
    validationSchema: InputValidationSchema,
    onSubmit
  });
  return <Form formikProps={formikProps}>
      <Form.FieldGroup>
        <Form.FieldControl control="text" label="Label" name="inputText" required helper="Helper Text" disable={formikProps.isSubmitting} />
      </Form.FieldGroup>
      <ButtonGroup>
        <Button title="Submit" type="submit" />
        <Button title="Reset" type="reset" color="grey" onClick={onReset} />
      </ButtonGroup>
    </Form>;
